(59,	4,	'iPhone Repair',	'&lt;p&gt;Modern smartphones are technologically advanced devices allowing anyone to check their email, navigate via GPS, and even manage finances all on the go. Among these mobile devices, the iPhone remains one of the leading contenders in the market. Having access to a trustworthy iPhone repair service can help users keep their devices running in top shape.&lt;/p&gt;\r\n\r\n&lt;p&gt;At uBreakiFix, we offer top notch repairs, extremely fast turnaround times, and excellent customer service. Whether you have the latest iPhone 5S / 5C or previous models such as the iPhone 4, iPhone 4S, iPhone 3GS or iPhone 3G, our repair services assure you of the finest repair quality and the fastest repair time available. We also cover both the Verizon, AT&amp;amp;T or Sprint versions.&lt;/p&gt;\r\n\r\n&lt;p&gt;Our iPhone repair services cover glass and LCD replacement, water damage, headphone jack replacement, home button repair, battery replacements and more. We can also fully refurbish any model iPhone to ensure that your phone looks and functions as good as new.&lt;/p&gt;\r\n\r\n&lt;p&gt;Their are 2 options available to fix your iphone. Your can choose to bring your iPhone in to one of our Nationwide walk-in repair locations in for speedy service where most repairs can be completed in less than 30 minutes or less. If you\'re not close to one of our local repair shops you also have the option to mail your iPhone in which usually takes about 4-7 business days.&lt;/p&gt;\r\n\r\n&lt;p&gt;For most of our iPhone repair services, we offer a same day turn around guarantee to assure you that no time is wasted in the repair of your device. As always we offer free diagnostics for all iPhones if you are not sure what damage your device has suffered.&lt;/p&gt;\r\n',	'iPhone Repair for iPhone 4, 4S, 5, 5S &amp; 5C - 90 Day Warranty on all Repairs &amp; Fastest Turnaround!  Call 877-320-2237 for Nearest iPhone Repair Locations',	''),
(71,	4,	'HTC Repair',	'&lt;h2&gt;Our HTC Repair Services&lt;/h2&gt;\n\n&lt;p&gt;Smartphones are widely considered a necessity in today\'s world. Among smartphone manufactures HTC has distinguished itself as one of the most innovative manufacturers on the market. From the HTC Aria to the HTC Evo 4G uBreakiFix offers a repair service that will cover your HTC device.&lt;/p&gt;\n\n&lt;p&gt;Android and Windows powered HTC smartphones are widely considered to be some of the most attractive and user friendly smartphones available. At uBreakiFix, we offer repair services that cover almost every HTC phone from smaller models like the HTC Incredible and the HTC Aria to newer models such as the HTC EVO 3D and the HTC Thunderbolt. Whether your phone has a cracked screen or is water damaged, the expert technicians at uBreakiFix have you covered.&lt;/p&gt;\n\n&lt;p&gt;Our technicians are trained to perform nearly any HTC repair in an expert fashion with only the highest quality parts available. Our walk-in repair centers are conveniently located nationwide and are proud to offer a 90 day warranty on all parts and labor for all HTC repairs. The majority of HTC repairs can be completed in 30 minutes or less while you wait.&lt;/p&gt;\n\n&lt;p&gt;If you are not located near one of our walk-in repair centers our mail-in repair facility can complete your repair and have it returned to you in as little as two days. Our mail-in service center provides an 8 hour turnaround guarantee on the majority of HTC repairs. If your phone is malfunctioning and you are unsure what service is required we can perform a diagnostic service in order to determine what HTC repair(s) are needed for your device.&lt;/p&gt;\n',	'Nationwide HTC Repair for all HTC Models - 90 Day Warranty on all Repairs &amp; Fast Turnaround!  Call 877-320-2237 to Find a Repair Location Near You!',	''),
